import React from 'react';
import './App.css';
import Navbar from './components/Navigate';
import About from './components/About';
import Contact from './components/Contact';

function App() {
  return (
    <div className="App">
        <Navbar />
        <About />
        <Contact />
    </div>
  );
}

export default App;
